import React, { Component } from 'react'

export default class Chat extends Component {


    matchMessageWithConvoId = () => {
    if (this.props.message_conversation_id === this.props.conversationId) {
        return (
            <div>
        <h1>{this.props.messageId} </h1> 
        <h2>{this.props.message.content}</h2>
        </div>
        )
    }
}

    render() {
        return (
            <div> 

    <div className="card" onClick={(event) => this.props.handleClick(event, this.props.messageID) } >
      <div className="card-body">
        <h5 className="card-title">
           Message ID: {this.props.messageId}
          </h5>
        <p className="card-text">
             {() => matchMessageWithConvoId()}
          </p>
      </div>
    </div>
    </div>


        )
}

}
